import React from 'react'
import SpotifyWebApi from 'spotify-web-api-js';
const spotifyApi = new SpotifyWebApi();

function GetPlaylists(){
  var i = "";
  spotifyApi.getUserPlaylists()
   .then((response) => {
     i = response.items[0].name;
     console.log(i);
   });
   // console.log(i);
   return <h1>{i}</h1>

}

export default GetPlaylists
